(function() {
	
var checkCanPlay = function (src,cb) {
	var audio = new Audio();
	var mime = src.split(";")[0];
	audio.id = "audio";
	audio.setAttribute("preload", "auto");
	audio.setAttribute("audiobuffer", true);
	audio.addEventListener("canplaythrough", function() {
		console.log("asdsd")
		cb(mime);
	}, false);
	audio.src = "data:" + src;
	document.body.appendChild(audio);
};

BKGM.audioDetect = function(callback) {
	var mime;
	var isSupport=false;
	// Check xem thẻ audio có hỗ trợ ko
	if (typeof(Audio) === "undefined") return callback(mime);
	// Nếu có thẻ audio thì tạo mới aduio
	var audio = new Audio();
	// Néu audio ko có kiểm tra type thì callback
	if (typeof(audio.canPlayType) === "undefined") return callback(mime);
	// Kiểm tra xem có đọc được file ogg (vorbis) hay mp3 (mpeg) không
	var ogg = audio.canPlayType('audio/ogg; codecs="vorbis"');
	ogg = (ogg === "probably" || ogg === "maybe");
	var mp3 = audio.canPlayType('audio/mpeg');
	mp3 = (mp3 === "probably" || mp3 === "maybe");
	// Không hỗ trợ cả file mp3 lẫn ogg
	if (!ogg && !mp3) {
		callback(mime);
		return;
	}
	// callback nếu hỗ trợ file gì đó
	var cb=function (m) {
		mime=m;
		callback(mime);
		isSupport=true;
		clearTimeout(timeout);
	}
	// hoặc hỗ trợ mp3 hoặc ogg
	if (ogg) checkCanPlay("audio/ogg;base64,",cb);
	if (mp3) checkCanPlay("audio/mp3;base64,",cb);
	
	var timeout = setTimeout(function(){
		if(!isSupport) callback(mime);
	},5000)
};

})();
(function(){
	window.AudioContext = window.AudioContext || window.webkitAudioContext;
BKGM.Sound =function(source, level) {
	if (!window.audioContext) {
		audioContext = new AudioContext();
	}
	var self = this;
	self.source = source;
	// self.buffer = null;
	self.isLoaded = false;
	self.panner = audioContext.createPanner();
	if(audioContext.createGain){
		self.volume = audioContext.createGain();
	} else{
		self.volume = audioContext.createGainNode();
	}
	if (!level) {
		self.volume.gain.value = 1;
	}
	else {
		self.volume.gain.value = level;
	}

	var getSound = Base64Binary.decodeArrayBuffer(self.source);
	audioContext.decodeAudioData(getSound, function(buffer) {
			self.isLoaded = true;
			self._isEnd=false;
			self.buffer=buffer;
			var sound = audioContext.createBufferSource();
			sound.buffer = buffer;
			sound.connect(self.panner);
			sound.playbackRate.value = 1;
			self.panner.connect(self.volume);
			self.volume.connect(audioContext.destination);
			self.sound=sound;
			self.onloaded();
			sound.onended=function(){
				if(self.ended) self.ended();
			};
		}
	);
	// console.log(getSound)
}

BKGM.Sound.prototype={
	play : function () {
		// Nếu sound đã load
		if (this.isLoaded === true) {
			
			this.sound.noteOn(0);
		}

	},
	forceplay : function(){
		var self=this;
		var sound = audioContext.createBufferSource();
		sound.buffer = this.buffer;
		sound.connect(this.panner);
		sound.playbackRate.value = 1;
		this.panner.connect(this.volume);
		this.volume.connect(audioContext.destination);
		self.sound=sound;
		if (sound.start){
			sound.start();
		} else{
			sound.noteOn(0);
		}		
					
		sound.onended=function(){
			if(self.ended) self.ended();
		};	
		
		
	},
	setVolume : function (level) {
		this.volume.gain.value = level;
	},
	setPan : function (xValue, yValue, zValue) {
		this.panner.setPosition(xValue,yValue,zValue);
	},
	noteOff : function (context) {
		context.noteOff(0);
	},
	onloaded : function(){

	}

}

})();